import React from 'react'
import Item from './Item'

function ItemList(props) {
  const a = [{icon: 'https://wow.zamimg.com/images/wow/icons/large/inv_weapon_shortblade_60.jpg', name: 'Кинжал скверного колдунства'},
    {icon: 'https://wow.zamimg.com/images/wow/icons/large/inv_weapon_shortblade_64.jpg', name: 'Проклятый ведьминский клинок Ваба'},
    {icon: 'https://wow.zamimg.com/images/wow/icons/large/inv_weapon_shortblade_58.jpg', name: 'Ярость Водоворота'}
  ]

  return (
    <div className='ItemList'>
      {props.items.map((item, index) =>
        <Item key={index} item={item}></Item>
      )}
    </div>
  )
}

export default ItemList
